window.bookSummaryJSON = "<p><b>Beaten, drugged, and tied, I sink beneath the surface.</b></p> <p>Water invades my mouth. It seeps down my throat and fills my lungs until breathing becomes a desperate memory.</p> <p>My only hope are the three men who know the evil of my attacker.</p> <p>If I make it through this, we can’t fail again. A murderer needs to be found. Caleb needs to pay for what he did to me.</p> <p>He has another woman held hostage, bound, and gagged.</p> <p>But she’s not the only one.</p> <p>There are others who will befall the same fate as me if Caleb and his friends aren’t stopped. With the police in his pocket, there’s no one to save them but us.</p> <p>Drowning gives a girl a lot of time to think about her revenge.</p> <p>Until it becomes obsession.</p> <p><b>Rebel Obsession </b><b><i>is an adult #whychoose romance, meaning the main character has more than one love interest. This book contains romantic suspense/dark themes that may trigger some listeners. It contains a male/male storyline. It is the second book in an ongoing trilogy and cannot be listened to as a standalone. Book 1 of this series is </i></b><b>Rebel Revenge</b><b><i>.</i></b></p>"; 
